import React from 'react';
import { IonTabBar, IonTabs, IonTabButton, IonContent } from '@ionic/react';

import BluetoothScan from "./bluetooth/index"

//import wifiScan from "./bluetooth/wifi" //uncomment with wifi implementation

class Main extends React.Component {
  render() {
    return (
      <IonContent>
        <BluetoothScan></BluetoothScan>
        <IonTabs>
          <IonTabBar slot="bottom">
            <IonTabButton tab="settings">

            </IonTabButton>
          </IonTabBar>
        </IonTabs>
      </IonContent>
    );
  };
}

export default Main;
